class momentumSGD(Optimizer):
  def __init__(self, lr = 0.01, momentum = 0.9):
    super().__init__()
    self.lr = lr
    self.momentum = momentum
    self.vs = {}

  def update_one(self, params):
    v_key = id(params)
    if v_key not in self.vs:
      xp = cuda.get_array_module(params.data)
      self.vs[v_key] = xp.zeros_like(params.data)

    v = self.vs[v_key]
    v *= self.momentum
    v -= self.lr * params.grad
    params.data += v

