def softmax_simple(x, axis = 1):
  x = as_variable(x)
  y = exp()
  sum_y = sum(y, axis = axis, keepdims = True)
  return y / sum_y

"""### 교차 엔트로피 오차 구현
- clip -> x_min 이하면 x_min으로 변환, x_max 이상이면 x_max로 변환

- np_arrange(N)은 ndarray 인스턴스 생성
ex) [0, 1, ~ , N-1] 형태

"""

def soft_max_cross_entropy_simple(x, t):
  x, t = as_variable(x), as_variable(t)
  N = x.shape[0]
  p = softmax(x)
  p = clip(p, 1e-15, 1.0)
  tlog_p = log(p)
  y = -1 * sum(tlog_p) / N
  return y

